window.bookSummaryJSON = "<p><b>Remember when seeing ghosts was my biggest problem? I miss those days.</b></p> <p>Now, I'm magically bonded (shackled) to a creature of unlimited destructive power. He insists we are destined for each other and that I will belong to him.</p> <p>If that wasn't enough, I've been kidnapped by another destructive creatureâ€”the one I'm supposed to help kill. Awkward, I know.</p> <p>It's rapidly becoming clear that I'm at the center of their tangled web of lies. A smart person would act meek and play along in hopes of surviving.</p> <p>Too bad I'm an idiot.</p> <p>There is a fury within me that is becoming harder to contain, and I refuse to be controlled by these overbearing (attractive) men.</p> <p>I will escape him, whether he wants me to or not.</p> <p><i>Contains mature content. A complete list of content warnings can be found on the author's website.</i></p>"; 
